function getColorGeol(sigla) {
    switch (sigla) {
        case 'Agua':
            return '#6ccbcb';
        case 'Cgm':
            return '#afafaf';
        case 'KE':
            return '#d1ff0f';
        case 'N2c':
            return '#ffdd99';
        case 'N2f':
            return '#ffeacc';
        case 'Nc':
            return '#ffff14';
        case 'Qa':
            return '#fff7e5';
        case 'Qfl':
            return '#b3fdb8';
        case 'Ql':
            return '#efefef';
        case 'Qlp-b':
        case 'Qlp-l':
        case 'Qlp-p':
        case 'Qlp-s':
            return '#fff7e5';
        case 'SDs':
            return '#e8b789';
        default:
            return '#000000'; // Color por defecto si la categoría no coincide con ninguna de las especificadas
    }
}


function styleGeol(feature) {
    return {
        fillColor: getColorGeol(feature.properties.sigla),
        weight: 1,
        opacity: 0.9,
        color: '#292828',
        dashArray: '0',
        fillOpacity: 0.9
    }
}




